import React from "react";

const Note = ({ note, toggleComplete }) => {
  return (
    <div style={{ display: "flex" }}>
      <input type="checkbox" />
      <li
        style={{
          textDecoration: note.completed ? "line-through" : null
        }}
      >
        {note.task}
      </li>
      <button>X</button>
    </div>
  );
};

export default Note;
